import { DefaultLayout } from "../../layouts";
//import MainSidebar from "../layout/MainSidebar/MainSidebar"

import { Container, Row, Col } from "shards-react";

function Ray(){
    return(
        <div>
            <Col
                className="main-content p-0"
                lg={{ size: 10, offset: 2 }}
                md={{ size: 9, offset: 3 }}
                sm="12"
                tag="main"
            >
                {!noNavbar && <MainNavbar />}
                <h1>Ray</h1>
                {children}
                {!noFooter && <MainFooter />}
            </Col>
        </div>
    )
}

export default Ray;
